[include mainsail.cfg]
[include mainboard.cfg]
[include display.cfg]
[include x.cfg]
[include y.cfg]
[include z.cfg]
[include extruder.cfg]
[include macros.cfg]
[include KAMP_Settings.cfg]
[include probe.cfg]

[printer]
kinematics: cartesian
max_accel: 8000
max_velocity: 500
max_z_velocity: 10
max_z_accel: 150

[skew_correction]

[input_shaper]

[virtual_sdcard]
path: ~/printer_data/gcodes

[display_status]

[pause_resume]

[force_move]
enable_force_move: True

[exclude_object]

[gcode_arcs]
resolution: 0.25


